import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { AdminRoute, UserRoute, AuthRoute } from './components/ProtectedRoutes';

// Pages
import Home from './pages/Home';
import AllPropertiesPage from './pages/AllPropertiesPage';
import ChaletDetailPage from './pages/ChaletDetailPage';
import Login from './pages/Login';
import Register from './pages/Register';
import AdminDashboard from './pages/AdminDashboard';
import UserDashboard from './pages/UserDashboard';
import DashboardOverview from './components/DashboardOverview';
import UserManagement from './components/UserManagement';
import PropertyManagement from './components/PropertyManagement';
import ReportsSection from './components/ReportsSection';
import ComingSoon from './pages/ComingSoon';
import NotFound from './pages/NotFound';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <main>
            <Routes>
              {/* Public routes - accessible to all */}
              <Route path="/" element={<Home scrollTo="hero" />} />
              <Route path="/home" element={<Home scrollTo="hero" />} />
              <Route path="/properties" element={<AllPropertiesPage />} />
              <Route path="/about" element={<Home scrollTo="about" />} />
              <Route path="/contact" element={<Home scrollTo="contact" />} />
              <Route path="/coming-soon" element={<ComingSoon />} />
              <Route path="/chalet/:slug" element={<ChaletDetailPage />} />

              {/* Authentication routes - redirect if already logged in */}
              <Route 
                path="/login" 
                element={
                  <AuthRoute>
                    <Login />
                  </AuthRoute>
                } 
              />
              <Route 
                path="/register" 
                element={
                  <AuthRoute>
                    <Register />
                  </AuthRoute>
                } 
              />

              {/* User-only routes */}
              <Route 
                path="/user-dashboard" 
                element={
                  <UserRoute>
                    <UserDashboard />
                  </UserRoute>
                } 
              />

              {/* Admin-only routes */}
              <Route 
                path="/admin-dashboard" 
                element={
                  <AdminRoute>
                    <AdminDashboard />
                  </AdminRoute>
                } 
              />
              <Route 
                path="/admin-dashboard/overview" 
                element={
                  <AdminRoute>
                    <DashboardOverview />
                  </AdminRoute>
                } 
              />
              <Route 
                path="/admin-dashboard/users" 
                element={
                  <AdminRoute>
                    <UserManagement />
                  </AdminRoute>
                } 
              />
              <Route 
                path="/admin-dashboard/properties" 
                element={
                  <AdminRoute>
                    <PropertyManagement />
                  </AdminRoute>
                } 
              />
              <Route 
                path="/admin-dashboard/reports" 
                element={
                  <AdminRoute>
                    <ReportsSection />
                  </AdminRoute>
                } 
              />

              {/* Catch-all route for 404 */}
              <Route path="*" element={<NotFound />} />
            </Routes>
          </main>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
